import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import GlobalStyle from "./Global/global"
import Boot from "./services/boot"

ReactDOM.render(
  <React.StrictMode>
    <Boot/>
    <GlobalStyle/>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

